查询资料的权利；女性普通会员有查看和回复其他会员站内消息的权利。<br><br>    6、VIP会员基本权利<br>  VIP会员基本权利是指本网站承诺除遭受不可抗力外，始终予以保证的VIP会员权利。<br>  VIP会员除以上普通会员享有的基本权力外，尚有如下基本权利：<br>  1）无限制发送站内消息；<br>  2）经其他会员同意获取其他会员联系方式；<br><br>    7、本网站权利<br>  本网站有随时填加、修改、删除会员所填资料（资料包括但不限于会员所上传头像、昵称、性别、居住地等）的权力，该权力可用于但不限于以下情况：<br>  1）出于网站宣传需要，网站宣传期通过行使本权力吸引更多会员加入，但于本协议中明确告知该事实情况；网站宣传主要目的在于增加会员数量，以使原会员拥有更多选择和被选择机会，以从长远角度符合会员利益；<br>  2）有任何理由怀疑会员所填资料的真实性、合法性、可靠性；<br>  3）防范会员恶意上传带有淫秽、色情、反动及其他非法图片的头像；<br>  4）防止黑客通过无限制调用会员上传照片耗用本网站服务器资源；<br>  5）其他本网站认为必要的情况。<br>  无论本网站何时以何方式行使该权力，上述5、6点会员之权利均须得以保证，特别是VIP会员第3条权利；会员对此不得提出异议。 <br><br>    8、免责条款<br>  1) 本网站不担保其提供的服务一定能满足会员的要求和期望，也不担保服务不会中断，对服务的及时性、安全性、出错发生都不作担保。<br>  2) 对于会员通过本网站提供的服务传送的内容，本网站已按照国家有关规定严格审查，但无法完全控制经由网站服务传送的内容，不保证内容的正确性、完整性或品质。因此会员在使用本网站服务时，可能会接触到令人不快、不适当或令人厌恶的内容。在任何情况下，本网站均不为会员经由网站服务以张贴、发送电子邮件或其它方式传送的任何内容负责。但本网站有权依法停止传输任何前述内容并采取相应行动，包括但不限于暂停会员使用网站服务的全部或部分，保存有关记录，并向有关机关报告。<br>  3) 对于本网站提供的各种广告信息、链接、资讯等，本网站不保证其内容的正确性、合法性或可靠性，相关责任由广告商承担；并且，对于会员经由本网站服务与广告商进行联系或商业往来，完全属于会员和广告商之间的行为，与本网站没有任何关系。对于前述商业往来所产生的任何损害或损失，本网站不承担任何责任。<br>  4) 对于用户上传的照片、资料等，本网站已采用相关措施进行审核，但不保证其内容的正确性、合法性或可靠性，相关责任由上传上述内容的会员负责。<br>  5) 会员以自己的独立判断从事与交友相关的行为，并独立承担可能产生的不利后果和责任，本网站不承担任何法律责任。<br>  6) 本网站对所有会员自发组织的活动、自发成立的组织不负责任。<br>  7) 对于会员的投诉，本网站将认真核实，但不保证最终公之于众的投诉的真实性、合法性，对于投诉内容侵犯会员隐私权、名誉权等合法权利的，所有法律责任由投诉者承担，与本网站无关。<br><br>      9、会员应遵守以下法律法规：<br>  1) 会员同意遵守《中华人民共和国合同法》、《中华人民共和国著作权法》、《全国人民代表大会常务委员会关于维护互联网安全的决定》、《中华人民共和国保守国家秘密法》、《中华人民共和国电信条例》、《中华人民共和国计算机信息系统安全保护条例》、《中华人民共和国计算机信息网络国际联网管理暂行规定》及其实施办法、《计算机信息系统国际联网保密管理规定》、《互联网信息服务管理办法》、《计算机信息网络国际联网安全保护管理办法》、《互联网电子公告服务管理规定》等相关中国法律法规的任何及所有的规定。<br>  2) 在任何情况下，如果本网站有理由认为会员的任何行为，包括但不限于会员的任何言论和其它行为违反或可能违反上述法律和法规的任何规定，本网站可在任何时候不经任何事先通知终止向该会员提供服务。<br><br>    10、禁止会员从事下列行为:<br>  1) 会员同意将不会利用本网站服务进行任何违法或不正当的活动，包括但不限于下列行为：发布信息或者利用本网站的服务时必须符合中国有关法规，不得在本网站的网页上或者利用本网站的服务制作、复制、发布、传播以下信息：反对宪法所确定的基本原则的；危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；损害国家荣誉和利益的；煽动民族仇恨、民族歧视、破坏民族团结的；破坏国家宗教政策，宣扬邪教和封建迷信的；散布谣言，扰乱社会秩序，破坏社会稳定的；散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；侮辱或者诽谤他人，侵害他人合法权利的；含有虚假、有害、胁迫、侵害他人隐私、骚扰、侵害、中伤、粗